public static String getUnits(String resourceValue) {
  String units;
  for (int i = 0; i < resourceValue.length(); i++) {
    if (Character.isAlphabetic(resourceValue.charAt(i))) {
      units = resourceValue.substring(i);
      if (StringUtils.isAlpha(units)) {
        return units;
      }
    }
  }
  return "";
}
